import React from 'react';

import { BrowserRouter, Route,Routes } from 'react-router-dom';


function App() {
  return (

    <div className='App'>
      {/* <Main/> */}
      <BrowserRouter>

      <Routes>
        <Route path="/" element={<Main />} />
        {/* <Route path="/page1/*" element={<CarPage />} />
        <Route path="/*" element={<NotFound />} /> */}
      </Routes>
    </BrowserRouter>

    </div>
  );
}

export default App;
